import styled from 'styled-components'
import { Box, Text, StyledOcticon } from '@primer/react'

const Command = (props) => {
    return(
        <CommandButton>
            <Box py={2} display="flex" alignItems="center" alignContent="center" justifyContent="space-between">
                <Box display="inline-flex" alignItems="center">
                    <StyledOcticon icon={props.icon || 'IssueOpenedIcon'} color="neutral.emphasis" />
                    <Text ml={3}>{props.name || "Command name"}</Text>
                </Box>
                <Text>{props.command || "⌘"}</Text>
            </Box>
        </CommandButton>
    )
}

export default Command;

const CommandButton = styled.button`
    display: block;
    width: 100%;
    border: none;
`;
